import NextApp, {AppInitialProps, AppProps, Container} from "next/app";
import * as React from "react";
import Head from "next/head";

interface BaseProps extends AppInitialProps, AppProps {}

class MyApp extends NextApp<BaseProps>{

    static async getInitialProps({ Component, ctx }: BaseProps) {
        const pageProps = Component.getInitialProps ? await Component.getInitialProps(ctx) : {};
        return pageProps;
    }

    render() {
        const { Component, pageProps } = this.props;

        return (
            <>
                <Head>
                    <title>Base</title>
                </Head>
                <Component {...pageProps} />
            </>
        )
    }
}
